import React from 'react';
import styled from "styled-components";
import {Title} from "../../styles/common";

const StyledLogo = styled.a`
  display: flex;
  
`

const LogoTitle = styled(Title)`
  
`

function Logo() {
  return (
    <StyledLogo href="/">
      <img src="./img/common/logo.svg" alt="Logo"/>
      <div>Organick</div>
    </StyledLogo>
  );
}

export default Logo;
